import styled from "styled-components";

const Li = styled.li`
    list-style: none;
    color: lightcoral;
`;

const Container = styled.div`
    width: 100vw;
    margin: 0 auto;
    text-align: center;
`;

const Title = styled.h1`
    font-size: 2rem;
`;

const Photo = styled.img`
    border-radius: 50%;
    width: 300px;
    height: 300px;
`;

export function List( props ) {

    // // Javascript 코딩 영역
