    /* <li>Banana</li>
       <li>Apple</li>
       <li>Grape</li> */

    return (
    <>
        <h1>List Components</h1>
        <p>리액트 연습 코드</p>
        <ul>
            {
                object.products.map((p)=> (
                    <Li>{p.title}</Li>
                ))
            }
        </ul>
        <Container>
            <Title>{object.user.name}</Title>
            <Photo src={object.user.imageUrl} />
        </Container>
    </>);
}
